import { Component } from 'react'
import AMap from './config'

var map,marker;

export class Map extends Component {
    componentDidMount(){

        map= new AMap.Map('map',{
            center:[114,35],
            zoom:12
        })

        marker= new AMap.Marker({
            position:[114,35],
            title:'村里'
        })

        map.add(marker)
    }



    render(){
        return null
    }
}

export default { mapjs,marker }
